import React, { useEffect } from 'react'
import Registercontent from "../components/registercontent/Registercontent"
import "./register.scss"


useEffect(() => {
  document.title = "Ani-Fox"
}, [])


export default function Login() {
  return (
    <div className="login">
        <Registercontent />
    </div>
  )
}
